import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M17 13.5c0-.83-.67-1.5-1.5-1.5h-7c-.83 0-1.5.67-1.5 1.5v.5c0 1.97 1.86 4 5 4 3.14 0 5-2.03 5-4v-.5zm-2.25-5.25a2.75 2.75 0 10-5.5 0 2.75 2.75 0 005.5 0zM22 12a10 10 0 11-20 0 10 10 0 0120 0zm-1.5 0a8.5 8.5 0 10-17 0 8.5 8.5 0 0017 0z", fill: primaryFill }));
};
const PersonCircle24Regular = wrapIcon(rawSvg({}), 'PersonCircle24Regular');
export default PersonCircle24Regular;
